import ExpenseItem from './ExpenseItem';
import './Expenses.css';
import Card from '../UI/Card';
import ExpensesFilter from './ExpenseFilter';
const Expenses=(props)=>{
  const selectExpenseYearHandler =(selectedExpenseYear)=>{
    const expenseYear={
      ...selectedExpenseYear,
      id: Math.random().toString()
  }
  // console.log(expenseData);
  props.onAddExpense(expenseYear);

  }



      return (

          <div>
          <ExpensesFilter  onSelectExpenseYear ={selectExpenseYearHandler}/>
          <Card className ="expenses">
          <ExpenseItem  title ={props.items[0].title} amount ={props.items[0].amount} date ={props.items[0].date} /> 
          <ExpenseItem title ={props.items[1].title} amount ={props.items[1].amount} date ={props.items[1].date} /> 
          <ExpenseItem title ={props.items[2].title} amount ={props.items[2].amount} date ={props.items[2].date} /> 
          <ExpenseItem title ={props.items[3].title} amount ={props.items[0].amount} date ={props.items[3].date} /> 


        </Card>
        </div>
      );

}

export default Expenses;
